"use strict";!function(){angular.module("clementineApp",["ngResource"]).controller("clickController",["$scope","$resource",function(c,e){var n=e("/api/clicks");c.getClicks=function(){n.query(function(e){c.clicks=e[0].clicks})},c.getClicks(),c.addClick=function(){n.save(function(){c.getClicks()})},c.resetClicks=function(){n.remove(function(){c.getClicks()})}}])}();